import api from "./api.service";
const url = "/cart";

class CartService {
  async addCart(id) {
    const res = await api.get(`${url}/add-to-cart/${id}`);
    console.log(res.data);
    return res.data;
  }
  async loginAccount(data) {
    const res = await api.post(`${url}/login`, data);
    console.log(res.data);
    return res.data;
  }
}
export default new CartService();
